import React, { Component } from "react";
import ReactPlayer from "react-player";

class Video extends Component {
  render() {
    return (
      <ReactPlayer
        url="https://player.vimeo.com/external/357646800.sd.mp4?s=e3e66dd3ca57f56c49a2c37712634d827f516235&profile_id=139&oauth2_token_id=57447761"
        playing
      />
    );
  }
}

export default Video;
